import LeftSideBar from "./LeftSideBar";
import "./LeftSideBar.css";
import "./MainScreen.css";

function MainScreen() {
  return (
    <div className="main-screen">
      <LeftSideBar />
      <h1>Hello world</h1>
    </div>
  );
}

export default MainScreen;
